import React from "react";

export default function UserSetup() {
  return (
    <div className="bg-white w-full h-full flex  justify-center p-4">
      <div className="w-200px h-200px bg-indigo-600">
        <input
          className="mt-20 absolute"
          type="text"
          placeholder="Enter your username"
        ></input>
        <button className="text-black rounded border-solid border-2">
          START GAME
        </button>
      </div>
    </div>
  );
}
